import React from 'react'

export default function Events() {
    return (
        <>  
         <div style={{padding:"12px 20px", backgroundColor:'black',color:'white',border:"2px solid #ecf0f1", outline:no }}>
            <button style={{backgroundColor:"red", color:"white", padding:"10px", borderRadius:"20px" }}>Click Me</button>
        </div>
        </>
    )
}
